br></p>'),(93,'en','App\\Entity\\Retouch','title','15','BALANCING'),(94,'en','App\\Entity\\Retouch','description','15','<p style=\"color: rgb(66, 114, 215); font-size: 14px; text-align: right;\"><strong>The content of your photo is good, but the rendering of the image unsatisfactory:</strong></p><p style=\"color: rgb(66, 114, 215); font-size: 14px; text-align: right;\">* We balance the chromium, the light.</p><p style=\"color: rgb(66, 114, 215); font-size: 14px; text-align: right;\">* We correct the optical distortions.</p><p style=\"color: rgb(66, 114, 215); font-size: 14px; text-align: right;\">* We recover (uncork) the external views.</p><p style=\"color: rgb(66, 114, 215); font-size: 14px; text-align: right;\">* The content of the image is not retouched.</p>'),(95,'en','App\\Entity\\Retouch','title','14','PHOTO STAGING 2D'),(96,'en','App\\Entity\\Retouch','description','14','<p style=\"text-align: right;\"><font color=\"#4272d7\"><span style=\"font-size: 14px;\">Empty / renovate</span></font></p><p style=\"text-align: right;\"><font color=\"#4272d7\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: right;\"><font color=\"#4272d7\"><span style=\"font-size: 14px;\">- We completely empty the room, We remove the curtains only when the external view and door frames are visible, to restore.</span></font></p><p style=\"text-align: right;\"><font color=\"#4272d7\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: right;\"><font color=\"#4272d7\"><span style=\"font-size: 14px;\">- We renovate floors, walls and ceilings, according to your requests, those of your customers or pre-selected samples.</span></font></p><p style=\"text-align: right;\"><font color=\"#4272d7\"><span style=\"font-size: 14px;\"><br></span></font></p><p style=\"text-align: right;\"><font color=\"#4272d7\"><span style=\"font-size: 14px;\">You can now project yourself into the current good, emptied of its content, with your future choices of color and material.</span></font></p>'),(97,'en','App\\Entity\\Retouch','title','13','RELEVANCE Â« EXTERIOR Â»'),(98,'en','App\\Entity\\Retouch','description','13','<p>For outdoor photos.&nbsp;<span style=\"font-size: 0.9375rem;\">Virtual storage and decluttering :</span></p><p>- We store personal belongings.</p><p>- We unclutter the exterior layout.</p><p>- We balance chromie &amp; light.</p><p>- We correct the optical distortions.</p>'),(99,'en','App\\Entity\\Retouch','title','12','RELEVANCE Â« INTERIOR Â»'),(100,'en','App\\Entity\\Retouch','description','12','<p>For indoor photos.</p><p>Virtual storage and decluttering:</p><p>- We store personal belongings,</p><p>- We unclutter the interior layout,</p><p>- We balance chromie &amp; light,</p><p>- We correct the optical distortions,</p><p>- We recover the external views.</p><p>This service has its limits, it requires to be able to reconstitute the materials, the forms, the style, the design of the furniture ...</p>'),(101,'en','App\\Entity\\Retouch','title','9','CREEPUSCULE\'S ATMOSPHERE'),(102,'en','App\\Entity\\Retouch','description','9','<p>Outdoor photos.</p><p>For refined atmospheres, or cozy end of the day.</p><p>- We apply a sunset sky,</p><p>- We adapt the chromium to reflections: windows, rivers, rivers, seas ...</p><p>- We turn on your outdoor lights,</p><p>- We highlight your pools.</p>'),(103,'en','App\\Entity\\Retouch','title','8','\"OUTDOOR\" LAYOUT'),(104,'en','App\\Entity\\Retouch','description','8','<p><strong>For outdoor photos.</strong></p><p>- We arrange your outdoor spaces according to your requests,</p><p>- We create non-existent lawns,</p><p>- We decorate your spaces of floral ornamentation, shrubs,</p><p>- We encrust garden furniture,</p><p>- We work the facades of goods,</p>'),(105,'en','App\\Entity\\Retouch','title','7','RELEVANCE \"EXTERIOR\"'),(106,'en','App\\Entity\\Retouch','description','7','<p>For outdoor photos.</p><p>Virtual storage and decluttering :</p><p>- We store personal belongings.</p><p>- We unclutter the exterior layout.</p><p>- We balance chromie &amp; light.</p><p>- We correct the optical distortions.</p>'),(107,'en','App\\Entity\\Retouch','title','6','RELEVANCE Â« INTERIOR Â»'),(108,'en','App\\Entity\\Retouch','description','6','<p>For indoor photos.</p><p>Virtual storage and decluttering:</p><p>- We store personal belongings,</p><p>- We unclutter the interior layout,</p><p>- We balance chromie &amp; light,</p><p>- We correct the optical distortions,</p><p>- We recover the external views.</p><p>This service has its limits, it requires to be able to reconstitute the materials, the forms, the style, the design of the furniture ...</p>'),(109,'en','App\\Entity\\Retouch','title','5','VIRTUAL PHOTO-STAGING'),(110,'en','App\\Entity\\Retouch','description','5','<p>For indoor photos. - Inlay of furniture / creation of Ambiance. - - Delivery delivered by default, to \"about 1 week\", even if included in 1 order in 48h or 24h.</p>'),(111,'en','App\\Entity\\Retouch','title','3','2D PHOTO-STAGING'),(112,'en','App\\Entity\\Retouch','description','3','<p>Empty / renovate</p><p>- We completely empty the room, We remove the curtains only when the external view and door frames are visible, to restore.</p><p>- We renovate floors, walls and ceilings, according to your requests, those of your customers or pre-selected samples.</p><p>- You can now project yourself into the current good, emptied of its content, with your future choices of color and material.</p>'),(113,'en','App\\Entity\\Retouch','title','2','RELEVANCE 360Â°'),(114,'en','App\\Entity\\Retouch','description','2','<p>For indoor photos.</p><p>Virtual storage:</p><p>- We store personal belongings,</p><p>- We balance chromie &amp; light,</p><p>- We recover the external views.</p><p>- No correction of optical distortions.</p>');
